import React from 'react'
import { Calendar, momentLocalizer } from 'react-big-calendar'
import moment from 'moment'
import { NavBar } from '../ui/NavBar'


const localizer = momentLocalizer(moment);

export const CalendarScreen = () => {
  return (
      <div>
          <NavBar/>

          <Calendar
      localizer={localizer}
      events={myEventsList}
      startAccessor="start"
      endAccessor="end"
      style={{ height: 500 }}
    />
      </div>
    
  )
}
